import React from "react";

const Home = () => {
  return (
    <div>
      <div className="table-data">
        <table>
          {total[0] && (
            <tr>
              <th>SI.NO</th>
              <th>Name</th>
              <th>Gender</th>
              <th>DoB</th>
              <th>Email</th>
              <th>Mobile</th>
              <th>location</th>
              <th className="empty"></th>
            </tr>
          )}
          {total.map((totals, index) => (
            <tr key={index}>
              <td>{index + 1}</td>
              <td className="ip">
                {totals.FirstName} {totals.LastName}
              </td>
              <td>{totals.Gender}</td>
              <td>{totals.DoB}</td>
              <td className="ip">{totals.Email}</td>
              <td>{totals.Mobile}</td>
              <td>{totals.location}</td>

              <button onClick={handleDelete} className="delete">
                Remove
              </button>
            </tr>
          ))}
        </table>
      </div>
    </div>
  );
};

export default Home;
